        if gt(power_1, div(not(0), base_1)) { panic_error_0x11() }
        power := mul(power_1, base_1)
    }
    function checked_exp_t_uint256_t_uint256(base, exponent) -> power
    {
        power := checked_exp_unsigned(base, exponent)
    }
